<?phpnamespace Nemundo\Meteo\Igra\Data\Country;class CountryModel extends \Nemundo\Model\Definition\Model\AbstractModel {/*** @var \Nemundo\Model\Type\Id\IdType*/public $id;/*** @var \Nemundo\Model\Type\Text\TextType*/public $countryCode;/*** @var \Nemundo\Model\Type\Text\TextType*/public $country;protected function loadModel() {$this->tableName = "igra_country";$this->aliasTableName = "igra_country";$this->label = "Country";$this->primaryIndex = new \Nemundo\Db\Index\AutoIncrementIdPrimaryIndex();$this->id = new \Nemundo\Model\Type\Id\IdType($this);$this->id->tableName = "igra_country";$this->id->fieldName = "id";$this->id->aliasFieldName = "igra_country_id";$this->id->label = "Id";$this->id->allowNullValue = false;$this->countryCode = new \Nemundo\Model\Type\Text\TextType($this);$this->countryCode->tableName = "igra_country";$this->countryCode->fieldName = "country_code";$this->countryCode->aliasFieldName = "igra_country_country_code";$this->countryCode->label = "Country Code";$this->countryCode->allowNullValue = false;$this->countryCode->length = 10;$this->country = new \Nemundo\Model\Type\Text\TextType($this);$this->country->tableName = "igra_country";$this->country->fieldName = "country";$this->country->aliasFieldName = "igra_country_country";$this->country->label = "Country";$this->country->allowNullValue = false;$this->country->length = 255;$index = new \Nemundo\Model\Definition\Index\ModelUniqueIndex($this);$index->indexName = "country_code";$index->addType($this->countryCode);}}